    }

    for (let edge of data["links"]) {
      num_out[edge.source] += 1;
      num_in[edge.target] += 1;
    }
    new Promise((resolve, _) => { resolve(data); }).then(data => {
      const Graph = ForceGraph()

        .linkDirectionalParticles(1)
